import React from 'react';
import './App.css';
import { Home, CreateWodRoute } from './routes';
import { Router, Route, Switch } from 'react';
function App() {
    return (
      <div>
        <Router>
        <div>
          <Switch>
            <Route path="/">
              <Home></Home>
            </Route>
            {/* <Route path="/create/wod" exact Component={CreateWodRoute}></Route> */}
          </Switch>

        </div>

        </Router>
      </div>
    );
}

export default App;
